    function isExclude(patterns) {
        var rr = /^\/(.+)\/$/
        var eps = (patterns || '').split(/[\r\n ]+/)
        for (var i = 0; i < eps.length; i++) {
            var reg = null
            if (rr.test(eps[i])) {
                reg = eps[i].match(rr)[1]
            }
            else {
                reg = wildcard2regep(eps[i])
            }
            if (eps[i].match(/[^\s+]/) && location.href.match(reg)) {
                return true
            }
        }
        return false
    }

